import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class WebBackendService {
  myArray: Array<any>;
  constructor(private http: HttpClient) {
    this.myArray = [];
   }

   runTest() {
    let test = this.http.get("http://10.0.0.43:7096/")
    .subscribe(value => {
      console.log(value);
    })
   }

   searchName(name: string) {
    return this.http.post("http://10.0.0.43:7096/api/nameSearch", { name: name})
    .subscribe(value => {
       console.log(value)
    })
   }

  getArray() {
    return this.myArray;
  }
}
